import React from 'react'

const Contact = () => {
  return (
    <div className='h-screen bg-[#1E1D1C] z-50 relative' id='contact'>
      <h1 className='text-white text-[40px] text-center'>Contact</h1>





      <border className="bg-[#b38859] absolute h-[45px] w-[100px] right-[30%] top-[21%] -z-20"></border>
    </div>
  )
}

export default Contact
